    /*------------------处理标准数据--------------------*/
    function formatDate(value) {
        var date = new Date(value);
        var y = date.getFullYear(),
            m = date.getMonth() + 1,
            d = date.getDate()

        if (m < 10) { m = '0' + m; }
        if (d < 10) { d = '0' + d; }

        var t = y + '-' + m + '-' + d
        return t
    }

    let startDate = "1992-01-28";

    shindex = shindex.filter(item => {
        return new Date(item[0]).getTime() >= new Date(startDate).getTime()
    }).map(item => {
        item[0] = item[0].slice(0, -2) + "28";
        return item;
    })

    let m1 = m1andppi.map((item, index, arr) => {
        let newArr = [];
        newArr[0] = item.date.slice(0, 4) + "-" + item.date.slice(4, 6) + "-28" //item.date; //"1999-12-30";

        newArr[1] = item.m1Yoy

        if (newArr[0].includes("01-28")) {
            let pre = arr[index - 1] ? arr[index - 1].m1Yoy : 0
            let next = arr[index + 1] ? arr[index + 1].m1Yoy : 0
            if ((pre * next) != 0)
                newArr[1] = (pre + next) / 2
            else
                newArr[1] = (pre + next)

            newArr[1] = newArr[1].toFixed(1)
        }

        return newArr
    })

    let ppi = m1andppi.map((item, index, arr) => {
        let newArr = [];
        newArr[0] = item.date.slice(0, 4) + "-" + item.date.slice(4, 6) + "-28"; //"1999-12-30";
        newArr[1] = item.ppiYoy //"19.38";
        return newArr
    })

    let m1MinusPpi = m1andppi.map((item, index, arr) => {
        let newArr = [];
        newArr[0] = item.date.slice(0, 4) + "-" + item.date.slice(4, 6) + "-28"; //"1999-12-30";
        newArr[1] = item.m1MinusPpi //"19.38";
        return newArr
    })



    let guZhaiBi = guzhaibiDate.map((item, index, arr) => {

        newArr[0] = item.slice(0, 4) + "-" + item.slice(5, 7) + "-28" //2002年01月

        return newArr
    })

    let guGdpBi = guGdp.map((item, index, arr) => {
        let newArr = [];
        newArr[0] = formatDate(item.date)
        newArr[1] = (item.marketCap / item.gdp).toFixed(3)
        return newArr
    })
    let guGdpBiX = guGdp.map((item, index, arr) => {
        let newArr = [];
